import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Products2 from './components/Products2'

class App extends Component {

  state = {
      products: []
    }

    componentDidMount() {
      this.fetchApi();
    }

    fetchApi = () => {
      const api = 'http://localhost:28071/api/items';

      fetch(api)
      .then(res => res.json())
      .then(data =>{
        this.setState({
          products: data
      })
      })
    }

  render() {
    console.log(this.state.products);
    return (
      <div className="App">
        <Products2 text={this.setState.products}/>

      </div>
    );
  }
}

export default App;
